// OVER DE SHOW //
Een unieke en pure stem die je omverblaast, daar draait het om in The Voice van Vlaanderen. Koen Wauters, Natalia, Bart Peeters en Alex Callier zijn weer van de partij als coach.

Artist : Spurv
